Furious 7 (2015) TS [RUS]

Storyline

Dominic Torretto and his crew thought they left the criminal mercenary life behind. They defeated an international terrorist named Owen Shaw and went their seperate ways. But now, Shaw's brother, Deckard Shaw is out killing the crew one by one for revenge. Worse, a Somalian terrorist called Jakarde, and a shady government official called &quot;Mr. Nobody&quot; are both competing to steal a computer terrorism program called God's Eye, that can turn any technological device into a weapon. Torretto must reconvene with his team to stop Shaw and retrieve the God's Eye program while caught in a power struggle between terrorist and the United States government.


Review by jackmcmeniman:
With stellar reviews already, Furious 7 is set to be the largest hit for the Furious franchise yet; and rightfully so. 

This movie masterfully displays just how deep the values of family and honour are embedded within the Furious characters. 

Paul Walker is fantastic in his last ever movie, alongside Vin Diesel and new addition Jason Stratham as the movies antagonist; this movie really deserves to be seen. 

Fan or not, there is no denying that Furious 7 will take you on a roller-coaster of a ride; emotionally and visually, culminating in the best, most enthralling Furious movie to date which will live on in fans' hearts forever.

